INSERT INTO PUBLIC.ARTICLE(ARTICLE_ID, TITLE, INGRESS, TEXT, AUTHOR, IMAGE_PATH, DATE_MADE) VALUES(9, 'Benny Garrison', 'Ben is the best m9 ever.', STRINGDECODE('<p>I never liked them motherfucking ben garrison wtf did&nbsp;;<em>What the fuck did you just fucking say about me, you little bitch? I&rsquo;;ll have you know I graduated top of my class in the Navy Seals, and I&rsquo;;ve been involved in numerous secret raids on Al-Quaeda, and I have over 300 confirmed kills. I am trained in gorilla warfare and I&rsquo;;m the top sniper in the entire US armed forces. You are nothing to me but just another target. I will wipe you the fuck out with precision the likes of which has never been seen before on this Earth, mark my fucking words. You think you can get away with saying that shit to me over the Internet? Think again, fucker. As we speak I am contacting my secret network of spies across theUSA&nbsp;;and your IP is being traced right now so you better prepare for the storm, maggot. The storm that wipes out the pathetic little thing you call your life. You&rsquo;;re fucking dead, kid. I can be anywhere, anytime, and I can kill you in over seven hundred ways, and that&rsquo;;s just with my bare hands. Not only am I extensively trained in unarmed combat, but I have access to the entire arsenal of the United States Marine Corps and I will use it to its full extent to wipe your miserable ass off the face of the continent, you little shit. If only you could have known what unholy retribution your little &ldquo;;clever&rdquo;; comment was about to bring down upon you, maybe you would have held your fucking tongue. But you couldn&rsquo;;t, you didn&rsquo;;t, and now you&rsquo;;re paying the price, you goddamn idiot. I will shit fury all over you and you will drown in it. You&rsquo;;re fucking dead, kiddo.</em></p>\r\n'), 1, '/assets/upload/hybrid/Ben Garrison shotgun.jpg', TIMESTAMP '2015-04-07 20:42:40.848');
